import React from "react";

import { HomePageContainer } from "./home.styles";

const Home = () => (
  <HomePageContainer>
    <div>
      <img
        src={require("../../assets/covid.jpg")}
        alt="covid"
        style={{ float: "left" }}
      />
    </div>
  </HomePageContainer>
);

export default Home;
